//Get Funds from users
//Withdraw Funds
//Set a minimum funding value in USD

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe {

    uint256 public minUSD=50;

    function fund() public payable{
        //want to be able to set a minimum fund amount in USD
        // How do we send ETH to this contract?

        require(msg.value >= minUSD, "The amount is less than 1ETH! Try Again."); // 1e18 == 1* 10 ** 18 = 100000000000000000 wei = 1eth

    }

    function getPrice() public view returns(uint256){
        //Since we will be interacting with an interface of chainlink which is essentially a contract
        //we will need 2 things:
        //Address : 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
        // ABI: import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        (,int price,,,) = priceFeed.latestRoundData(); //ETH in terms of USD
        return uint256(price * 1e10); // 1*10 == 10000000000


        
    }

    //function getConversionRate() {}
    //function withdraw(){

    // }


}

